import React, { Component } from 'react';
import CardList from './CardList';
import SearchBox from './SearchBox'
import { robots } from './robots';

class App extends Component{
    constructor(){
        super()
        this.state = {
            robots: robots,
            searchField: ''
        }
    }
    render(){
        return (
            <main className='tc'> 
                <h1>Robo Friends</h1>
                <SearchBox />
                <CardList robots={this.state.robots} />
        </main>
        )
    }
}

export default App;
